        "description": "Janet Jackson is a groundbreaking artist in pop music. She emerged from the shadows of her brothers -- who were also part of the successful Jackson 5 in the 70s -- and forged an image and successful music career all her own.\n\nEven when her brother Michael Jackson became a global superstar, Janet still held her own, and albums like Janet and The Velvet Rope became her signature works, also cementing her place as a sex symbol.\n\nJanet has had her ups and downs throughout her storied career but she somehow manages to push it aside and reinvent herself every time. And now, her recent new look is turning heads again.\n\n#JanetJackson #Transformation #Music\n\nHumble beginnings | 0:00\nShedding that good girl image | 1:01\nConfronting her demons | 1:38\nAdvocating for the LGBT community | 2:41\nMTV's first-ever icon | 3:36\nThe infamous wardrobe malfunction | 4:17\nHonoring Michael | 5:36\nRevealing her struggles | 6:22\nPaying it forward | 7:07\nLaunching her record label | 7:52\nBecoming a mother | 8:36\nCrushing that body | 9:21\nTaking a stand for equality | 10:36\nPutting in the work | 11:25\n\nRead Full Article: https://www.thelist.com/69370/stunning-transformation-janet-jackson/",
