        "description": "1 Hour of ski music to relaxing powder ski footage all shot in Idaho, filmed and skied by Dan Noakes. If you need your skiing fix while you are stuck at home, at the office, hanging out with friends, chill and relax to this mix of lofi hip hop while watching relaxing powder ski POV footage. This video includes 1 hour of relaxing backcountry powder skiing footage. Watch the whole thing or have it playing in the background. Memorizing ski footage that will make you feel like you are skiing right beside me. This chillhop and lofi hip hop mix was all filmed during the winter of 2020/2021 in Idaho in the Payette and Boise National Forests, and the Lost River Range. \n\nPlease subscribe, like, and comment on this video. I would love to hear from you.\n\nMUSIC CREDIT\nHanz - Conflicted https://chll.to/a19abd5f\nHanz - Falling Short https://chll.to/37a287ba\nHanz - From Afar https://chll.to/f66c70fd\nHanz - Out of Place https://chll.to/230eb451\nHanz - Rolling Eyes https://chll.to/e2c04316\nSmile High, Teddy Roxpin - Looking In https://chll.to/5a2e2ad0\nSmile High, Teddy Roxpin - Seeds for Tomorrow https://chll.to/197d3218\nSmile High, Teddy Roxpin - Odyssey https://chll.to/d8b3c55f\nSmile High, Teddy Roxpin - This Too Shall Pass https://chll.to/4e8bffba\nCloudchord, Smile High, Teddy Roxpin - Sirens https://chll.to/c6dc0d81\nSmile High, Teddy Roxpin - Deja https://chll.to/9be0dd97\nSmile High, Teddy Roxpin - Transparent https://chll.to/5a27cc51\nSmile High, Teddy Roxpin - Leches On the Menjay https://chll.to/9be93b16\nDelayde, anybodyy - Where The Sun Goes https://chll.to/82879bbf\nLiphe - Little Bird https://chll.to/5517e2bf\nPsalm Trees - The Shortest Day Alone https://chll.to/a3f4626f\nIan Ewing - Claire2 https://chll.to/276e7c53\nAves, Snoophkeen - Matoki https://chll.to/6b69410d\nfantompower - Vitamin D https://chll.to/19720935\nMiddle School - When I Get Up In the Morning https://chll.to/f0fcd7c4\nLeavv, Makzo - Viatecture https://chll.to/9d21d1e0\nArbour - Golden Gardens https://chll.to/eac0dc0e\n\n#skimusic #skiingmusic #skiingpov",
