        "title": "VANS SNOWBOARDING PRESENTS: ELLES | Snow | VANS",
        "description": "A short film featuring Arthur Longo, made with friends near and far during winter 2021. Featuring Arthur Longo, Dan Liedahl, Mary Rand, Blake Paul, and more. Filmed by Jake Price, Harry Hagan, and Olivier Gittler. Directed and edited by Tanner Pendleton.\n\nMusic Credits: \n“Instrumentals Vol. 1 Pt. 3” by Arthur Russel\n“It Takes a Muscle” by Spectral Display\n\"Raum\" by Grauzone\n“The Camp” by Trisomi 24\n“I So Liked Spring” by Linda Smith\n\nAbout Vans Snow:\nFor more than 20 years, Vans Snow has stood for one thing: pushing the limits of what’s possible through progression and innovation. Founded in our rich heritage and evolved through purpose-built products, Vans Snow is dedicated to unlocking your most genuine expression of style.\n\nVans Global Snow Team: \nArthur Longo, Benny Urban, Blake Paul, Bryan Iguchi, Cole Navin, Dan Liedahl, Darrell Mathes, Dillon Ojo, Hana Beaman, Jake Kuzyk, Jamie Lynn, Kennedi Deck, Mary Rand, Mike Ravelson, Parker Szumowski, Pat Moore, Sam Taxwood, and Wolle Nyvelt.\n\nDiscover more Vans Snow Content:\nhttps://youtube.com/playlist?list=PL1BBD39C847F5D5B4\n \nLearn more about Vans Snow:\nhttps://www.vans.com/snow.html?icn=subnav \n\nAbout Vans:\nVans®, a VF Corporation (NYSE: VFC) brand, is the original action sports footwear, apparel, and accessories brand. Vans® authentic collections are sold in 97 countries through a network of subsidiaries, distributors, and international offices. Vans® has over 2,000 retail locations globally including owned, concession and partnership doors. The Vans® brand promotes creative self-expression in youth culture across action sports, art, music, and street culture and delivers progressive platforms such as Vans Checkerboard Day, Vans Park Series, Vans Triple Crown of Surfing®, Vans Custom Culture, and Vans’ cultural hub and international music venue, House of Vans.\n\nConnect with Vans:\nhttp://www.vans.com/snow\nhttp://www.instagram.com/vanssnow\nhttp://www.tiktok.com/@vans\n \nSubscribe now at: \nhttp://www.youtube.com/vans",
